import React, {Component} from 'react';
import Node from './Node/Node';
import './algovis.css'

export default class algovis extends Component{
    constructor(props){
        super(props);
        this.state = {};
    }

    componentDidMount(){
        const nodes = [];
        for(let i = 0; i < 15; i++){
            const currentRow = [];
            for(let j = 0; j < 50; j++){
                currentRow.push([]);
            }
            nodes.push(currentRow);
        }

        this.setState({nodes});
    }

    render(){
        const {nodes} = this.state;
        console.log(nodes);
        return(
            <div>
                {nodes.map((row, rowIdx) =>{
                    return <div>
                        {row.map((node, nodeIdx))}
                    </div>
                })}
            </div>
        )
    }
}
